func testDTBClassNameToManyRemoveOpClassNameDTBClassCategories(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a DTBClassName
	var b, c, d, e DTBClassCategory

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, dtbClassNameDBTypes, false, strmangle.SetComplement(dtbClassNamePrimaryKeyColumns, dtbClassNameColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*DTBClassCategory{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, dtbClassCategoryDBTypes, false, strmangle.SetComplement(dtbClassCategoryPrimaryKeyColumns, dtbClassCategoryColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	err = a.AddClassNameDTBClassCategories(ctx, tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.ClassNameDTBClassCategories().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveClassNameDTBClassCategories(ctx, tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.ClassNameDTBClassCategories().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if !queries.IsValuerNil(b.ClassNameID) {
		t.Error("want b's foreign key value to be nil")
	}
	if !queries.IsValuerNil(c.ClassNameID) {
		t.Error("want c's foreign key value to be nil")
	}

	if b.R.ClassName != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if c.R.ClassName != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if d.R.ClassName != &a {
		t.Error("relationship to a should have been preserved")
	}
	if e.R.ClassName != &a {
		t.Error("relationship to a should have been preserved")
	}

	if len(a.R.ClassNameDTBClassCategories) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.ClassNameDTBClassCategories[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.ClassNameDTBClassCategories[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

